It can be any of: Instant: Effect is executed once and removed Duration: Effect is stuck on the player for a duration duration_ms Permanent: Effect lasts forever and can only be removed by other effects Periodic: Like an Instant, but the effect is applied many times over a period of time instant_application: Boolean specifying if first application of effect should happen at instant 0 or not interval_ms: Every X milliseconds the effect will be applied trigger_count: Sets how many times the effect will be applied For Duration and Periodic the configuration expects a JSON object with a type field corresponding to the type { "type": "Duration", "duration_ms": 1234
