To learn more about attributes see the Attributes section, below you can find quick links to the documentation for each entity with changeable attributes Player attributes Projectile attributes An attribute change is comprised of the following: attribute: Attribute to modify, the exact values allowed depend on the entity you are modifying. If the attribute is a map you can either provide the attribute to modify all or use . syntax to only target a key in it modifier: Determines how value interacts with the current value of the attribute, it can be one of additive: Given value is added to current value multiplicative: Given value is multiplied to current value override: Given value is set as the attribute value value: The value we are using for the change # Heal by 20%
