In the architecture walkthrough above, we glossed over how the game state is handled. Currently, it consists of two things: A list of players, each of which has an id, a position, and a health value. A board, which is just a matrix indicating what each cell on the map contains (whether it's empty, has a player in it, etc). This state is kept inside the Runner process, but state transitions (players moving, attacking, etc) are computed in Rust. To call Rust code from Elixir we use Rustler , which allows us to write NIFs; a way to call low level performant code inside the Erlang VM. You can read more about them here and here . All the Rust game state code is located inside the native/gamestate directory. The functions exposed to Elixir are all in the lib.rs file. Here's the function that we call to move players around the map: #[rustler::nif(schedule = "DirtyCpu")]
fn move_player(game: GameState, player_id: u64, direction: Direction) -> GameState { let mut game_2 = game; game_2.move_player(player_id, direction); game_2
} The associated Elixir function is inside the Engine.Game module: def move_player(_a, _b, _c), do: :erlang.nif_error(:nif_not_loaded) The magic that makes this call Rust underneath is all inside this use declaration use Rustler, otp_app: :dark_worlds_server, crate: "gamestate" Every Rust Struct has a corresponding Elixir struct that it maps to; calling the Elixir functions is transparent to someone using the API.
